import React from "react";
import Cards from "./Card";
import Button from "@material-ui/core/Button"
import PlayArrowIcon from '@material-ui/icons/PlayArrow';
import './Grid.css';


const Grid = () => {
    return ( 
        <>
        <Button variant="contained" style = {{fontSize:'50px'}}>
        <PlayArrowIcon className="Freccia" style = {{fontSize:'50px'}}/>
         PLAY
        </Button>
        </>
     );
}
 
export default Grid;
